import React from "react";
import { useNavigate } from "react-router-dom";
import "../styles/homepage.css";

const Home = () => {
  const navigate = useNavigate();

  return (
    <div className="home-container">
      {/* üîù Header */}
      <header className="header">
        <div className="logo">EV Connect</div>
        <button className="login-btn" onClick={() => navigate("/login")}>Login</button>
      </header>

      {/* üéØ Hero Section */}
      <section className="hero">
        <h1>Seamless Charging, Anytime, Anywhere</h1>
        <p>Find and book the nearest EV charging stations effortlessly.</p>
        <button className="get-started-btn" onClick={() => navigate("/explore")}>
          Get Started üöÄ
        </button>
      </section>

      {/* ‚ÑπÔ∏è About EV Connect */}
      <section className="about">
        <h2>About EV Connect</h2>
        <p>EV Connect helps you find and book EV charging stations in real-time.</p>
        <div className="features">
          <div className="feature-card">üìç Locate Charging Stations</div>
          <div className="feature-card">üìÖ Book Slots with Ease</div>
          <div className="feature-card">üîã Optimize Charging Efficiency</div>
        </div>
      </section>

      {/* üí° Why Choose Us */}
      <section className="why-choose">
        <h2>Why Choose Us?</h2>
        <div className="benefits">
          <div className="benefit-card">üåç Eco-Friendly</div>
          <div className="benefit-card">üöÄ Fast & Reliable</div>
          <div className="benefit-card">üîê Secure Payments</div>
          <div className="benefit-card">üìç Smart Location Services</div>
        </div>
      </section>

      {/* üîó Call to Action */}
      <section className="cta">
        <h2>Ready to Charge?</h2>
        <button className="cta-btn" onClick={() => navigate("/signup")}>
          Join Now üöó‚ö°
        </button>
      </section>
    </div>
  );
};

export default Home;
